    #region MENSAJES

    private void Mensajes(string mensaje, int opc)
    {
        string script = "";
        switch (opc)
        {
            case 0:
                script = @"<script type='text/javascript'> alert('" + mensaje + "'); </script>";
                ScriptManager.RegisterStartupScript(this, typeof(Page), "alerta", script, false);
                break;
            case 1:
                script = @"<script type='text/javascript'> alert('" + mensaje + "'); window.close(); </script>";
                ScriptManager.RegisterStartupScript(this, typeof(Page), "alerta", script, false);
                break;
            case 2:
                break;
            case 6:
                // permite abrir una ventana adicional como popup
                string popupScript = "<script language='JavaScript'> " + "{ " + " var leftPos = (screen.width-600)/2; " + " var topPos = (screen.height-400)/2; " + " window.open('" + mensaje + "','Info','status=0 , titlebar=0, location=0, scrollbars=1, status=no, resizable=0, menubar=no, top='+ topPos +', left='+ leftPos ); " + "} </script> ";
                ScriptManager.RegisterStartupScript(this, this.GetType(), "", popupScript, false);
                break;
            case 7:
                // permite abrir una ventana adicional como popup
                string popupScript2 = "<script language='JavaScript'> " + "{ " + " var leftPos = (screen.width-750)/2; " + " var topPos = (screen.height-400)/2; " + " window.open('" + mensaje + "','Info','Width=900px, Height=500px, status=0 , titlebar=0, location=0, scrollbars=1, status=yes, resizable=1, menubar=no, top='+ topPos +', left='+ leftPos ); " + "} </script> ";
                ScriptManager.RegisterStartupScript(this, this.GetType(), "", popupScript2, false);
                break;
            case 8:
                // permite abrir una ventana adicional como popup
                string popupScript3 = "<script language='JavaScript'> " + "{ " + " var leftPos = (screen.width-600)/2; " + " var topPos = (screen.height-400)/2; " + " window.open('" + mensaje + "','Info','Width=800px, Height=400px, status=0 , titlebar=0, location=0, scrollbars=1, status=yes, resizable=1, menubar=no, top='+ topPos +', left='+ leftPos ); " + "} </script> ";
                ScriptManager.RegisterStartupScript(this, this.GetType(), "", popupScript3, false);
                break;
        }
    }

