        private void GUARDAR_1(GridViewCommandEventArgs e, int opcion)
        {
            try
            {
                GridViewRow gvRow = (GridViewRow)(((ImageButton)e.CommandSource).NamingContainer);
                creacion_mensajes mensajes = new creacion_mensajes();
                int valor = 0;

                mensajes.P_ID_MENSAJES = Convert.ToInt32(((Label)gvRow.FindControl("ID_MENSAJES")).Text);
                ViewState["ID_MENSAJES"] = mensajes.P_ID_MENSAJES;

                try
                {

                    mensajes.P_CALIFICACION_TEXT = "1";
                    mensajes.P_ID_TIPO_MENSAJE = 2;
                    mensajes.P_USUARIO = Convert.ToInt32(Session["id_usuario"]);


                    if (opcion == 1)
                    {

                        valor = FachadaPersistencia.getInstancia().Administrar_calificacion(mensajes, opcion);

                        if (valor != 0)
                        {
                            Mensajes("GRACIAS POR SU CALIFICACION", 0);

                        }
                        else
                        {
                            Mensajes("Seleccionar un estado por favor", 0);
                        }
                    }

                }
                catch
                {
                    Mensajes("Ya califico esta publicacion, seleccione otra", 0);
                }

                return;
            }

            catch
            {
                Mensajes("Error al realizar la consulta", 0);
            }
        }

